import {
	FETCH_OFFERED,
	STATUS_OFFERED,
	MESSAGE_OFFERED,
} from 'constants/types/offered';

export const statusCourses = (status) => ({
	type: STATUS_OFFERED,
	payload: status,
});

export const fetchCourses = (offered) => ({
	type: FETCH_OFFERED,
	payload: offered,
});

export const messageCourse = (message) => ({
	type: MESSAGE_OFFERED,
	payload: message,
});
